import React from 'react';

const Post = ({ posts }) => {
    if (!posts || posts.length === 0) {
        return <div>Loading...</div>;
    }

    // 投稿データを表示
    return (
        <div>
            {posts.map(post => (
                <article key={post.id}>
                    {/* 投稿データの表示 */}
                    <h2>{post.title}</h2>
                    <p>{post.content}</p>
                    {/* 他の投稿データを表示 */}
                </article>
            ))}
        </div>
    );
};

export default Post;
